import React from 'react';
import  Professional from './Professional';
import  Personal from './Personal';
import  Upload from './Upload';
import  Varification from './Varification';
import { Route, Switch } from 'react-router-dom';
import './index.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const App = () => {

    return (
              <>
               <h1 className="text-center my-3">Helpworx Technology Private Limited</h1>
                     <div className="container mx-auto">
                         <div className="row">

                         <div class="btn-group my-5" role="group" aria-label="Basic outlined example">
  <button type="button" class="btn btn-outline-primary"><a href="/Personal">Personal Details</a></button>
  <button type="button" class="btn btn-outline-primary"><a href="/Professional">Professional Details</a></button>
  <button type="button" class="btn btn-outline-primary"><a href="/Upload">Upload Sample</a></button>
  <button type="button" class="btn btn-outline-primary"><a href="/Varification">Varification</a></button>
</div>
                         <div class="btn-group" role="group" aria-label="Basic checkbox toggle button group">
                         <input type="checkbox" class="btn-check" id="btncheck0" autocomplete="off"/>
                        <label class="btn btn-outline-primary" for="btncheck0">Checkbox </label>
  
  <input type="checkbox" class="btn-check" id="btncheck1" autocomplete="off"/>
  <label class="btn btn-outline-primary" for="btncheck1">Checkbox 1</label>

  <input type="checkbox" class="btn-check" id="btncheck2" autocomplete="off"/>
  <label class="btn btn-outline-primary" for="btncheck2">Checkbox 2</label>

  <input type="checkbox" class="btn-check" id="btncheck3" autocomplete="off"/>
  <label class="btn btn-outline-primary" for="btncheck3">Checkbox 3</label>
</div>

                         </div>
                     </div>
                 

               
                <Switch>
                    <Route exact path="/Personal" component={Personal}/>
                    <Route exact path="/Professional" component={Professional}/>
                    <Route exact path="/Upload" component={Upload}/>
                    <Route exact path="/Varification" component={Varification}/>
                </Switch>
                
              </>

    );
}
export default App;
